import { useState } from "react";

function Questions( {id ,  q , a } )
{

    const [show , setShow] = new useState(false);

    return (
      <>
        <div className="qna">
          <div className="que">
            <button>+</button>
            <h3>{q}</h3>
          </div>
          {show && <p className="ans">
            {a}
          </p> }
        </div>
      </>
    );
}

export default Questions;
